	(1, 'PT FWD Life Indonesia', 'Jalan Sudirman', 'DKI Jakarta', '+62 1500 391', 'cs@fwd.co.id', 'data:image/png;base64,', '<p>PT FWD Life Indonesia ("FWD Life") adalah perusahaan asuransi jiwa patungan dan merupakan bagian dari FWD Group. FWD Life berdiri sejak November 2012 dan memperoleh izin di bidang asuransi jiwa dari Otoritas Jasa Keuangan (OJK) pada bulan Februari 2013. FWD Life terdaftar dan tunduk pada pengawasan OJK. iFWD Liberate adalah nama salah satu jalur distribusi asuransi melalui daring (online) dari FWD Life.</p>', 'http://instagram.com/@fwd', 'http://youtube.com/@fwd', 'http://facebook.com/fwd', 'http://twitter.com/@fwd', 1);
