	(1, '2017-11-04 10:05:40', 'Mario Iroth', 37, 'Founder Wheel Story', '<p>Proteksi asuransi sangat penting terlebih untuk kegiatan extreme yang kami lakukan yaitu traveling bermotor, banyak hal yang bisa terjadi diluar dugaan.</p><p>Kami merupakan pemegang produk asuransi personal accident FWD Life Bebas Aksi, dimana proses pembelian dapat dilakukan dengan sangat mudah,  secara online melalui website FWD Life. Dengan Bebas Aksi juga mendukung passion kami sepenuhnya  sampai passion dengan risiko tinggi sekalipun seperti yang kami lakukan sekarang ini.</p>', 'data:image/png;base64,', 'http://wheelstoryadv.com', 1, 'data:image/png;base64,', 1),
	(2, '2017-11-02 22:18:41', 'Patrix Tenario', 39, 'Designer', '<p>BAF, BAF apa yg ngeselin? BAFering pas nonton YouTube, tapi kalo BAF dari FWD sih selalu nyenengin, makasih FWD!</p>', 'data:image/png;base64,', 'http://designer.com', 0, NULL, 1),
	(3, '2017-11-04 10:08:33', 'Patrixs', 40, 'Designer', '<p>BAF, BAF apa yg ngeselin? BAFering pas nonton YouTube, tapi kalo BAF dari FWD sih selalu nyenengin, makasih FWD!</p>', 'data:image/png;base64,', 'http://designer.com', 0, '', 1),
	(4, '2017-11-04 14:15:48', 'Riza Dwi Arifiyanto', 31, 'Programmer', '<p>Testing aja ini</p>', 'data:image/png;base64,', 'test.co.id', 0, '', 1);
